      out.write("\t\t\t\t乃是地藏菩萨经案下伏着的通灵神兽。可以通过听来辨认世间万物 尤其善于听人的心。\r\n");
      out.write("\t\t\t</p>\r\n");
      out.write("\t\t\t<p>传说是地藏菩萨的坐骑，谛听的原身是一条白犬，因为地藏法门以孝道为基，狗性忠诚，就如同文殊之狮子表智慧，普贤之白象表大行一样，地藏之谛听表忠诚不二之心。</p>\r\n");
      out.write("\t\t\t<p>东北大学计算机学院姚羽教授组织学生编写研发——谛听(ditecting)网络空间工控设备搜索引擎，取谛听辨识万物之意，意在搜寻暴露在互联网上的工业控制系统联网设备， 帮助安全厂家维护工控系统安全、循迹恶意企图人士。</p>\r\n");
      out.write("\t\t\t<p>通过谛听，你可以定位工控设备位置，捕捉开放端口，发现安全漏洞。通过谛听，你可以直观感受全球工控安全形势，关注你身边的工控系统安全。 谛听旨在为工控安全提供开放自由的研究环境，善用谛听，关注工控系统安全，促进工控安全发展。</p>\r\n");
      out.write("\t\t\t<!-- <p class=\"sum\">该套系统提供了强大的搜索查询功能，支持多种模式的设备搜索。主要包括：位置、端口、服务类型等。</p> -->\r\n");
